import React from "react";
import "./Apod.scss";
import { connect } from "react-redux";
import getApodAsync from "../../Redux/Apod/apod-actions";
import PictureofTheDayContainer from "../../Components/PictureOfTheDay/PictureOfTheDayContainer";
import { selectIsApodLoaded } from '../../Redux/Apod/apod-selectors';

class Apod extends React.Component {
  componentDidMount() {
    const {getApodAsync} = this.props;
    getApodAsync();
  }
  render() {
    return (
      <div className="apod">
        {this.props.isApodLoaded ? <PictureofTheDayContainer /> : null} 
      </div>
    );
  }
}

const mapStateToProps = state => ({
  isApodLoaded: selectIsApodLoaded(state)
});

const mapDispatchToProps = dispatch => ({
  getApodAsync: () => dispatch(getApodAsync())
});

export default connect(mapStateToProps, mapDispatchToProps)(Apod);
